  <h3 class="mb-7 text-center">Tu n’est pas seul•e.</h3>

</section>
<div class="mx-7 flex flex-col gap-8">
<p>Les rêves peuvent fréquemment provoquer des sentiments intenses, et il est crucial que tu les identifies et que tu parvienne à les gérer. Te sentir débordé•e, inquiet•ète ou triste de temps à autre est parfaitement normal. Éprouver des émotions désagréables fait partie de la vie, alors ne sois pas trop sévère avec toi-même.
</p>
  <p>Veiller sur ton bien-être émotionnel et mental, c’est hyper important, tout comme tu prendrais soin de ta santé physique. Si tu te sens triste, inquiet•ète, déprimé•e, ou si tu combats d'autres émotions difficiles depuis un certain temps, il pourrait être bénéfique que tu discutes avec quelqu'un qui peut apporter un soutien professionnel. Un•e psychologue peut te fournir un espace sécurisé pour explorer ces sentiments et travailler à les comprendre.
  </p>
  <p>Tu n'es pas seul•e dans cette démarche. Si tu as besoin de parler, nous sommes là. Écris-nous et nous ferons tout notre possible pour te répondre le plus rapidement possible.</p>
</div>
